import React, { useEffect } from "react";
import { useNavigate } from "react-router-dom";
import Navbar from "../components/Navbar";
import Header from "../components/Header";
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  BarElement,
  Title,
  Tooltip,
  Legend,
} from "chart.js";
import { Bar } from "react-chartjs-2";

ChartJS.register(
  CategoryScale,
  LinearScale,
  BarElement,
  Title,
  Tooltip,
  Legend
);

function AdminDashboard() {
  const navigate = useNavigate();
  const user = JSON.parse(localStorage.getItem("user"));

  useEffect(() => {
    if (!user || user.role !== "admin") {
      navigate("/"); // Redirect to homepage if not an admin
    }
  }, [user, navigate]);

  // Sample data for the bar chart (Customer Map)
  const customerMapData = {
    labels: ["Area A", "Area B", "Area C", "Area D", "Area E", "Area F"],
    datasets: [
      {
        label: "Number of Customers",
        data: [150, 210, 80, 320, 110, 180],
        backgroundColor: [
          "#FF6B6B",
          "#4BC0C0",
          "#FFDA6B",
          "#B370CF",
          "#76D7EA",
          "#F7DC6F",
        ],
      },
    ],
  };

  const customerMapOptions = {
    responsive: true,
    plugins: {
      title: {
        display: true,
        text: "Customer Map",
      },
      legend: {
        display: false, // Hide legend for this simple chart
      },
    },
    scales: {
      y: {
        beginAtZero: true,
        title: {
          display: true,
          text: "Number of Customers",
        },
      },
    },
  };

  return (
    <div className="flex h-screen overflow-hidden">
      {/* Sidebar (Navbar) */}
      <Navbar />

      {/* Main Content */}
      <div className="flex-1 flex flex-col overflow-hidden">
        {/* Header */}
        <Header />

        {/* Dashboard Content */}
        <main className="flex-1 bg-gray-100 p-4 overflow-y-auto">
          <div className="container mx-auto grid grid-cols-1 md:grid-cols-4 gap-4">
            {/* Top Widgets */}
            <div className="bg-white shadow rounded-md p-4">
              <h3 className="text-lg font-semibold text-gray-700">
                Total Orders
              </h3>
              <p className="text-2xl font-bold text-green-500">75</p>
            </div>
            <div className="bg-white shadow rounded-md p-4">
              <h3 className="text-lg font-semibold text-gray-700">
                Transactions
              </h3>
              <p className="text-2xl font-bold text-green-500">357</p>
            </div>
            <div className="bg-white shadow rounded-md p-4">
              <h3 className="text-lg font-semibold text-gray-700">
                New Customers
              </h3>
              <p className="text-2xl font-bold text-green-500">65</p>
            </div>
            <div className="bg-white shadow rounded-md p-4">
              <h3 className="text-lg font-semibold text-gray-700">
                Total Revenue
              </h3>
              <p className="text-2xl font-bold text-green-500">$128</p>
            </div>

            {/* Overview (Pie Chart Placeholder) */}
            <div className="bg-white shadow rounded-md p-4 md:col-span-2">
              <h3 className="text-lg font-semibold text-gray-700 mb-2">
                Overview
              </h3>
              <div className="flex justify-around">
                <div className="text-center">
                  <div className="w-16 h-16 rounded-full bg-red-200 flex items-center justify-center text-red-500 font-bold text-lg">
                    81%
                  </div>
                  <p className="text-sm text-gray-600 mt-1">Total Order</p>
                </div>
                <div className="text-center">
                  <div className="w-16 h-16 rounded-full bg-green-200 flex items-center justify-center text-green-500 font-bold text-lg">
                    22%
                  </div>
                  <p className="text-sm text-gray-600 mt-1">Customer Growth</p>
                </div>
                <div className="text-center">
                  <div className="w-16 h-16 rounded-full bg-blue-200 flex items-center justify-center text-blue-500 font-bold text-lg">
                    12%
                  </div>
                  <p className="text-sm text-gray-600 mt-1">Total Revenue</p>
                </div>
              </div>
            </div>

            {/* Order Chart (Line Chart Placeholder) */}
            <div className="bg-white shadow rounded-md p-4 md:col-span-2">
              <h3 className="text-lg font-semibold text-gray-700 mb-2">
                Order Chart
              </h3>
              <div className="h-32 bg-gray-200 rounded flex items-center justify-center text-gray-500">
                Placeholder for Line Chart
              </div>
            </div>

            {/* Total Revenue Trend (Line Chart Placeholder) */}
            <div className="bg-white shadow rounded-md p-4 md:col-span-2">
              <h3 className="text-lg font-semibold text-gray-700 mb-2">
                Total Revenue Trend
              </h3>
              <div className="h-32 bg-gray-200 rounded flex items-center justify-center text-gray-500">
                Placeholder for Line Chart
              </div>
            </div>

            {/* Customer Map (Bar Chart) */}
            <div className="bg-white shadow rounded-md p-4 md:col-span-2">
              <h3 className="text-lg font-semibold text-gray-700 mb-2">
                Customer Map
              </h3>
              <Bar options={customerMapOptions} data={customerMapData} />
            </div>
          </div>
        </main>
      </div>
    </div>
  );
}

export default AdminDashboard;
